INSERT INTO `v1_4781c22c66377b86f9ea12f7a98b27a3080f4a369eb71e15dc75506ac0f1f627` VALUES (6000, "逆境に屈することなく、部員たちを引っ張る主将。ミート力を活かした安定感のある打撃が持ち味。", "---", 1, "アサヒ", 1, 0, "", 2, 3);
INSERT INTO `v1_4781c22c66377b86f9ea12f7a98b27a3080f4a369eb71e15dc75506ac0f1f627` VALUES (16000, "無愛想だが仲間を大切に想う気持ちは誰よりも強い男。ケンカで鍛えた腕っぷしが自慢のパワーヒッター。", "アドレナリン", 3, "部員3", 1, 3, "ホームランを連発すると、連発数に応じてパワーアップする", 3, 0);
INSERT INTO `v1_4781c22c66377b86f9ea12f7a98b27a3080f4a369eb71e15dc75506ac0f1f627` VALUES (30000, "みんなからの厚い信頼を集める期待の助っ人部員。実力は未知数だが幸運なハプニングを呼び込む。", "ラッキー", 2, "{0}", 1, 2, "幸運のハプニングを呼び込む", 4, 2);
INSERT INTO `v1_4781c22c66377b86f9ea12f7a98b27a3080f4a369eb71e15dc75506ac0f1f627` VALUES (50000, "みんなの知らない極秘情報がのっているおまけページ。決して誰かに見せてはいけない。", "", 0, "選手名鑑 おまけページ", 0, 1, "", 5, 1);
